import React, { useState } from "react";
import Container from "./UI/Container";

const users = [];

const RenderUser = (props) => {
  users.push(props);
  if (users.length <= 1) {
    return (
      <Container>
        <p>No entries found</p>
      </Container>
    );
  }
  console.log(users);
  return <Container></Container>;
};

export default RenderUser;
